import React from 'react'

const Header = () => {
  return (
    <div className='flex h-20 w-full shadow-md'>
        <div className='flex items-center justify-center w-full bg-white text-blue-700 hover:text-blue-900'>
            <p>SIH</p> Logo
            <p className='text-3xl'><b>Protein Analysis Model</b></p>
        </div>
    </div>
  )
}

export default Header
